import React from "react";

const AddCustomerForm = () => {
	return (
		<div clas>
			<input placeholder="Tên"></input>
			<input placeholder="Tuổi"></input>
			<input placeholder="Địa chỉ"></input>
			<input placeholder="Số điện thoại"></input>
			<div>
				<button>Add</button>
				<button>Close</button>
			</div>
		</div>
	);
};

export default AddCustomerForm;
